import React from "react";
import { Link } from "react-router-dom";

function Footer() {
    return (
        <div className="h-28 w-full fixed bottom-0 flex flex-row align-center justify-evenly bg-red-500">
            <div>col1</div>
            <div>col2</div>
            <div>col3</div>
            <div>col4</div>
            <div>col5</div>
        </div>
    )
}

export default Footer;
